import { Container, Card, Row, Col, Button, Form} from "react-bootstrap";
import "../css.css";
import React, { useContext, useEffect, useState } from 'react';
import RecipeItem from "../components/RecipeItem";
import RecipeList from "../components/RecipeList";
import {Context} from "../index";
import { useHistory } from 'react-router-dom';
import { observer } from "mobx-react-lite";
import { RECIPES_ROUTE } from "../utils/consts";
import time1 from "../assets/2278023 (1).png";
import time2 from "../assets/2278021 (1).png";
import time3 from "../assets/2278019 (1).png";
import time4 from "../assets/2278024 (1).png";


const Main = observer(() => {
    const {recipe} = useContext(Context)
    const history = useHistory()
    const [complex, setComplex] = useState('')
    const [time, setTime] = useState('')
    const [kcal, setKcal] = useState('')
    // useEffect(()=>{
    //     fetchRecipes().then(data=> recipe.setRecipe(data.rows))
    // },[])
        return (
            

            <Container
            className="tbody"> 
            
            <Container className="found">

            <Container className="time">
                <h2 className="textfound">Время приготовления: {time} минут</h2>
                <Button className="buttime" value={'15'} onClick={e => setTime(e.target.value)}><img src={time3} className="imgtime"/>
                    15 минут
                </Button>

                <Button className="buttime" value={'30'} onClick={e => setTime(e.target.value)}><img src={time2} className="imgtime"/>
                    30 минут
                </Button>

                <Button className="buttime" value={'45'} onClick={e => setTime(e.target.value)}><img src={time1} className="imgtime"/>
                    45 минут
                </Button>

                <Button className="buttime" value={'60'} onClick={e => setTime(e.target.value)}><img src={time4} className="imgtime"/>
                    60 минут
                </Button>
            </Container>
            
            <Container className="slozh">
                <h2 className="textfound">Сложность: {complex}</h2>
                <Button className="butslozh" value={'легко'} onClick={e => setComplex(e.target.value)}>Легко</Button>
                <Button className="butslozh" value={'средне'} onClick={e => setComplex(e.target.value)}>Средне</Button>
                <Button className="butslozh" value={'сложно'} onClick={e => setComplex(e.target.value)}>Сложно</Button>
            </Container>

            <Container className="kcal">
                <h2 className="textfound">Калорийность: {kcal}</h2>
                </Container>
                <Container className="kcal0">
                <text className="textkcal">50 &emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp; 1000</text>
                <Form.Control type="range" onChange={e => setKcal(e.target.value)}
                 class="form-range" min="50" width='50%' max="1000" step="50" id="customRange3"/>  
            </Container>

            </Container>

            <Container className="cards">
                <h2 className="textpop">Популярные рецепты</h2>
                <Row><Col md={9}>
            <Row className="d-flex">
            
                <RecipeList/>
               
            <Button className="morerec" onClick={() => history.push(RECIPES_ROUTE)}>Больше рецептов</Button>
            </Row>
            </Col> </Row>
            </Container>
            <div className="prtype"></div>
            </Container>
        );
});

export default Main;
